	add("specialization", "{\"term\":\"specialization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|specialize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of specializing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, q:Robert A. Heinlei\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Time Enough For Love Robert A. Heinlein, \u0027\u0027Time Enough For Love\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A human being should be able to change a diaper, plan an invasion, butcher a hog, conn a ship, design a building, write a sonnet, balance accounts, build a wall, set a bone, comfort the dying, take orders, give orders, cooperate, act alone, solve equations, analyze a new problem, pitch manure, program a computer, cook a tasty meal, fight efficiently, die gallantly. \u0027\u0027Specialization\u0027\u0027 is for insects\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act or process becoming specialized\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The adaptation of an organism to a specific environment, or adaptation of an organ to a particular function\", \"priority\":6}]}, \"synonyms\":{}}");

