	add("specimina", "{\"term\":\"specimina\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027: International Phenomenological Society, \u0027Philosophy and Phenomenological Research\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dZscSAAAAIAAJ\u0026amp;q\u003dspecimina\u0026amp;dq\u003dspecimina\u0026amp;lr\u003d\u0026amp;pgis\u003d1 pages 177\u0026lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt;, 178\u0026lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt;, 180\u0026lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt;]\u0026lt;/span\u0026gt;, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dZscSAAAAIAAJ\u0026amp;q\u003d%22only+very+few+specimina%22\u0026amp;dq\u003d%22only+very+few+specimina%22\u0026amp;lr\u003d\u0026amp;pgis\u003d1 p184\u0026lt;sup\u0026gt;{4}\u0026lt;/sup\u0026gt;]\u0026lt;/span\u0026gt;, and \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dZscSAAAAIAAJ\u0026amp;q\u003d%22to+assort+all+red+specimina%22\u0026amp;dq\u003d%22to+assort+all+red+specimina%22\u0026amp;lr\u003d\u0026amp;pgis\u003d1 p189\u0026lt;sup\u0026gt;{5}\u0026lt;/sup\u0026gt;]\u0026lt;/span\u0026gt; (State University of New York at Buffalo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; Particularly interesting and revealing was the behavior of the patient, when he was given a color-specimen (e.g., a red one) and was requested to sort out all those \u0027\u0027specimina\u0027\u0027 as agreed with the former in hue, though they might differ as to brightness, warmth, etc.\u0026lt;sup\u0026gt;12\u0026lt;/sup\u0026gt; Th. proceeded with much uneasiness and hesitation. Sometimes he tried to assort \u0027\u0027specimina\u0027\u0027 of equal or very similar hue, sometimes \u0027\u0027specimina\u0027\u0027 of different hue which, however, agreed as to brightness. \u0026lt;br\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; It goes without saying that Th. sometimes grouped \u0027\u0027specimina\u0027\u0027 agreeing in hue. Whether or not two color-\u0027\u0027specimina\u0027\u0027 appear to him as fitting together depends entirely and exclusively upon whether or not he has the experience of \u0027concrete agreement\u0027, \u0027accordance\u0027, and \u0027coherence\u0027 (“konkretes Kohärenzerlebnis”) on account of the particular characteristic individual aspects which the \u0027\u0027specimina\u0027\u0027 present to him. In the case of identical \u0027\u0027specimina\u0027\u0027, the patient obviously experiences concrete agreement to the highest possible degree; hence he is prompt and unhesitating in assorting such \u0027\u0027specimina\u0027\u0027. \u0026lt;br\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt; To assort color-\u0027\u0027specimina\u0027\u0027 with reference to a principle of classification requires adoption of the “categorial” attitude, whether the principle of classification is adhered to consistently, i.e., for a certain length of time or is adopted for a brief moment only. \u0026lt;br\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{4}\u0026lt;/sup\u0026gt; It is obviously with respect to only very few \u0027\u0027specimina\u0027\u0027 that the mentioned experience takes place, whereas other \u0027\u0027specimina\u0027\u0027 of the same hue, but of brightness, saturation, and other chromatic properties different from those of the object in question appear inappropriate and incongruous. \u0026lt;br\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{5}\u0026lt;/sup\u0026gt; It is more or less under this phenomenal aspect that Gelb and Goldstein presume the heap of color-\u0027\u0027specimina\u0027\u0027 to appear to their patient. When, however, under the influence of a given assignment, e.g., that to assort all red \u0027\u0027specimina\u0027\u0027, the normal person abandons his heretofore passive attitude, the instability and agitation of the heap of color-\u0027\u0027specimina\u0027\u0027, the vacillation of conflicting\", \"priority\":6}]}, \"synonyms\":{}}");

