	add("spectrum", "{\"term\":\"spectrum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027spectrum\u0027 (appearance, image, apparition) from \u0027speciō\u0027 (look at, view) (see scope)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Specter, apparition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A range; a continuous, infinite, one-dimensional set, possibly bounded by extremes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Specifically, a range of colours representing light (electromagnetic radiation) of contiguous frequencies; hence electromagnetic spectrum, visible spectrum, ultraviolet spectrum, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 October 30, Jim Giles, \u0027Jammed!\u0027, in \u0027w:New New Scientist\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Current 3G technologies can send roughly 1 bit of data - a one or a zero - per second over each 1 Hz of \u0027\u0027spectrum\u0027\u0027 that the operator owns\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The autism spectrum\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The pattern of absorption or emission of radiation produced by a substance when subjected to energy (radiation, heat, electricity, etc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The set of eigenvalues of a matrix\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Of a bounded linear operator \u0027A\u0027, the set of scalar values λ such that the operator \u0027A—λI\u0027, where \u0027I\u0027 denotes the identity operator, does not have a bounded inverse; intended as a generalisation of the linear algebra sense\", \"priority\":9}]}, \"synonyms\":{}}");

