	add("speedup", "{\"term\":\"speedup\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* {{compound|speed|up|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An amount or rate of decrease in time taken\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The relationship between time taken and number of processors used\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an employer\u0027s demand for more output without more pa\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dWith constant \u0027\u0027speedup\u0027\u0027 of the line and with the cold temperatures of the plant, one angry worker told me, “After ten years, people walk like they\u0027re sixty or seventy.\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

