	add("spelk", "{\"term\":\"spelk\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|spelke}}, from Old english (ca. 450-1100) {{m|ang|spilc}}, \u0027spelc\u0027 (a splint) from Proto-germanic {{m|gem-pro|*spelkō}}, {{m|gem-pro|*spalka-||bast, splint}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A splinter, usually of wood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A wooden splinter caught under the skin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Unusably short lengths of fiber-reinforced material, such as prepreg\", \"priority\":3}]}, \"synonyms\":{}}");

