	add("speller", "{\"term\":\"speller\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who spells\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m a good \u0027\u0027speller\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Michael W. Riley, \u0027Plato\u0027s Cratylus: Argument, Form, and Structure\u0027 (page 124\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Without insisting on a difference between the inventors and the \u0027\u0027spellers\u0027\u0027 of words, Socrates makes short work of this case\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A participant in a spelling bee\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A book for learning spellings\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A spell checker\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, \u0027PC Mag\u0027 (volume 6, number 17, page 358\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"But Word\u0027s spelling program still isn\u0027t fully integrated into the word processor. For one thing, any changes and corrections you make from the \u0027\u0027speller\u0027\u0027s menus don\u0027t appear on-screen until you get back to your original file\", \"priority\":9}]}, \"synonyms\":{}}");

	add("spellfire", "{\"term\":\"spellfire\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|spell|fire|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The exchange of shots or explosive blasts of spells (from a wand, staff, etc.) as in magical combat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Lucy Sussex, Judith Raphael Buckrich, \u0027She\u0027s fantastical\u0027 (page 191\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Just the tiniest speck of \u0027\u0027spellfire\u0027\u0027 pushed into his palm\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Sean K. Reynolds, Angel Leigh McCoy, Duane Maxwell, \u0027Magic of Faerun\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She gains one level of \u0027\u0027spellfire\u0027\u0027 energy for every spell level absorbed and can store a number of spellfire energy levels equal to her Constitution\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Laura Anne Gilman, \u0027Flesh and Fire\u0027 (page 370\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Jerzy watched the two of them, coming to Agreement over the flickering tendrils of \u0027\u0027spellfire\u0027\u0027, and felt something twist in his gut\", \"priority\":7}]}, \"synonyms\":{}}");

	add("spellwork", "{\"term\":\"spellwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|spell|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any magical practice involving creating or casting spells, especially new enchantments or spells which are intricate or complex\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Edain McCoy, \u0027A Witch\u0027s Guide to Faery Folk\u0027, ISBN 9780875427331, [http://books.google.ca/books?id\u003d_P5fcbMQMKEC\u0026amp;dq\u003dspellwork+subject%3A%22fiction%22\u0026amp;q\u003d%22All+spellwork%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003d%22All%20spellwork%22\u0026amp;f\u003dfalse p. 116\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"All \u0027\u0027spellwork\u0027\u0027 with faeries should be done within the safe confines of your circle, with the faeries just outside its perimeter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Louie Jerome, \u0027Peter and the Black Dog\u0027, ISBN 9781606937372, [http://books.google.ca/books?id\u003dmztz77yiRe4C\u0026amp;dq\u003dspellwork+subject%3A%22fiction%22\u0026amp;q\u003d%22spell+work+was%2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003d%22spell%20work%20was%22\u0026amp;f\u003dfalse p. 46\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I did have a passing interest in Wicca, but once I realized that \u0027\u0027spell work\u0027\u0027 was involved, I stopped\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The formula or formulation of one or more spells or enchantments; the individual parts constituting such a formulation; the inner workings or structure of a spell\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, \u0026quot;\u0027Celtic Magic\u0027 by w:D. J. D. J. Conway\u0026quot; (advertisement) in Ted Andrews, \u0027Enchantment of the Faerie Realm\u0027, ISBN 9780875420028, [http://books.google.ca/books?id\u003dYIsMX2rcGqIC\u0026amp;dq\u003dspellwork+subject%3A%22fiction%22\u0026amp;q\u003d%22the+spellwork%2\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003d%22the%20spellwork%22\u0026amp;f\u003dfalse p. 224\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"There is also an in-depth discussion of Celtic deities and the Celtic way of life and worship, so that an intermediate practitioner can expand upon the \u0027\u0027spellwork\u0027\u0027 to build a series of magical rituals\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, w:Richard A. Richard A. Knaak, \u0027Legacy of Blood\u0027, ISBN 9780743423120, [http://books.google.ca/books?id\u003dS23AFXReYMMC\u0026amp;dq\u003dspellwork+subject%3A%22fiction%22\u0026amp;q\u003dThe+spellwor\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003d%22The%20spellwork%22\u0026amp;f\u003dfalse p. 82\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027spellwork\u0027\u0027 she had utilized to quicker get her to her destination had taken too much from the dark mage\", \"priority\":14}]}, \"synonyms\":{}}");

