	add("spermatozoid", "{\"term\":\"spermatozoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A motile, ciliated male gamete produced in the antheridium of an alga, fern or gymnosperm\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spermatozoon", "{\"term\":\"spermatozoon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027σπέρμα\u0027 (sperm) + \u0027ζῷον\u0027 (living thing)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reproductive cell or gamete of a male, carried in semen, that fertilizes an ovum to produce a zygote\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spermicide", "{\"term\":\"spermicide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sperm|cide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A substance used for killing sperm\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spermidine", "{\"term\":\"spermidine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The triamine \u0027N-(3-aminopropyl)butane-1,4-diamine\u0027, originally obtained from semen, that is involved in cell metabolism\", \"priority\":1}]}, \"synonyms\":{}}");

